import React from "react";
import { CircularProgress, Grid, Typography } from "@material-ui/core";
// hook
import { useFetch } from "../../../hooks";
// components
import CultrueCards from "./CultureCards";
import { FormControlLabel, Collapse, Paper, Switch } from "@material-ui/core/";

const ClientInstitution = () => {
  const [checked, setChecked] = React.useState(false);
  const handleChange = () => {
    setChecked((prev) => !prev);
  };

  const { data, isLoading } = useFetch("/cultures/group");
  <FormControlLabel
    control={<Switch checked={checked} onChange={handleChange} />}
    label="Show"
  />;
  const cultureCards = data.map((information) => (
    <Grid key={information._id} item xs={12}>
      <FormControlLabel
        control={<Switch checked={checked} onChange={handleChange} />}
        label="Show"
      >
        {information._id}
      </FormControlLabel>
      <CultrueCards
        countrySource={information._id}
        information={information.data}
      />
    </Grid>
  ));

  return (
    <div>
      <Grid item xs={12}>
        <Grid container spacing={3}>
          {isLoading ? (
            <Grid item xs={12}>
              <CircularProgress />
            </Grid>
          ) : (
            cultureCards
          )}
        </Grid>
      </Grid>
    </div>
  );
};

export default ClientInstitution;
